import{_ as e,c as t,a2 as a,o as i}from"./chunks/framework.3fgD02ok.js";const n="/rby1-dev/assets/using-included-pc.Cxh9SA0o.png",s="/rby1-dev/assets/using-your-own-pc.C0pHlzfK.png",f=JSON.parse('{"title":"Access Information","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"docs/development/getting-started/access-information.md","filePath":"docs/development/getting-started/access-information.md"}'),r={name:"docs/development/getting-started/access-information.md"};function l(d,o,c,h,m,u){return i(),t("div",null,o[0]||(o[0]=[a('<h1 id="access-information" tabindex="-1">Access Information <a class="header-anchor" href="#access-information" aria-label="Permalink to &quot;Access Information&quot;">‚Äã</a></h1><p>This section provides details about how to connect to the Robot PC from the User PC, including network addresses, credentials, and Web UI access.</p><h2 id="network-information" tabindex="-1">Network Information: <a class="header-anchor" href="#network-information" aria-label="Permalink to &quot;Network Information:&quot;">‚Äã</a></h2><ul><li><p>Robot PC IP Address (User PC to Robot PC): 192.168.30.1</p></li><li><p>Robot PC IP Address (Hotspot Connection: <code>192.168.12.1</code></p><ul><li>Hotspot SSID: <code>RBY1</code></li><li>Hotspot Password: The password can be viewed after connecting via QR code. <blockquote><p>üîë <strong>Connecting via QR Code</strong></p><ol><li>Press the <strong>HOTSPOT button</strong> on the top of the robot&#39;s backpack to activate the hotspot.</li><li>A QR code will be displayed; scan it to automatically connect to the network.</li></ol><ul><li>The hotspot will remain active <strong>only while the HOTSPOT button is pressed</strong>.</li><li>Ensure the button is not pressed again during robot operation, as this will deactivate the hotspot and disrupt communication with the robot.</li></ul></blockquote></li></ul></li></ul><h2 id="web-ui-access" tabindex="-1">Web UI Access <a class="header-anchor" href="#web-ui-access" aria-label="Permalink to &quot;Web UI Access&quot;">‚Äã</a></h2><ul><li>User PC(UPC) to Robot PC(RPC): 192.168.30.1:5173</li><li>Hotspot Connection: 192.168.12.1:5173</li></ul><h2 id="access-credentials" tabindex="-1">Access Credentials <a class="header-anchor" href="#access-credentials" aria-label="Permalink to &quot;Access Credentials&quot;">‚Äã</a></h2><ul><li>User PC Username: <code>nvidia</code></li><li>User PC Password: <code>nvidia</code></li></ul><blockquote><p>‚ö†Ô∏è <strong>Note</strong><br> The default credentials are standard for Nvidia Jetson devices.</p></blockquote><h2 id="command-information" tabindex="-1">Command Information <a class="header-anchor" href="#command-information" aria-label="Permalink to &quot;Command Information&quot;">‚Äã</a></h2><ul><li>Command Port: 50051 (Use this port to send commands to the Robot PC.)</li></ul><h2 id="sending-commands-to-the-robot" tabindex="-1">Sending Commands to the Robot <a class="header-anchor" href="#sending-commands-to-the-robot" aria-label="Permalink to &quot;Sending Commands to the Robot&quot;">‚Äã</a></h2><h3 id="from-the-user-pc-upc" tabindex="-1">From the User PC (UPC) <a class="header-anchor" href="#from-the-user-pc-upc" aria-label="Permalink to &quot;From the User PC (UPC)&quot;">‚Äã</a></h3><ol><li><p><strong>Direct Command via Code:</strong></p><ul><li>Send commands to the Robot PC at <code>192.168.30.1:50051</code> from the UPC by writing code that interfaces with the robot.</li></ul></li><li><p><strong>SSH Connection:</strong></p><ul><li>You can also SSH into the UPC and send commands to the Robot PC at <code>192.168.30.1:50051</code>.</li></ul><blockquote><p>üí° The UPC only supports <strong>wired connections</strong>, so if you need a wireless solution, you&#39;ll need to implement it manually.</p></blockquote></li></ol><figure><img src="'+n+'" alt="missing" style="width:80%;margin:auto;"><figcaption style="text-align:center;">[ (Option 1) Using included PC as UPC ]</figcaption></figure><h3 id="from-another-pc-your-own-pc" tabindex="-1">From Another PC(Your own PC) <a class="header-anchor" href="#from-another-pc-your-own-pc" aria-label="Permalink to &quot;From Another PC(Your own PC)&quot;">‚Äã</a></h3><p>There are two methods to send commands to the Robot PC from another PC:</p><ol><li><p><strong>Using Hotspot:</strong></p><ul><li>Connect the other PC to the same Wi-Fi as the Robot PC via the <strong>HOTSPOT</strong>.</li><li>Send commands to <code>192.168.12.1:50051</code>.</li></ul></li><li><p><strong>Using a Separate Wi-Fi Network:</strong></p><ul><li>Connect the Robot PC and your PC to a different Wi-Fi network.</li><li>Assign the Robot PC to that Wi-Fi network.</li><li>Send commands to the <strong>Robot PC&#39;s IP address</strong> on the same network, followed by <code>:50051</code> for the command port.</li><li>More detailed instructions on this method will be provided later.</li></ul></li></ol><figure><img src="'+s+'" alt="missing" style="width:100%;margin:auto;"><figcaption style="text-align:center;">[ (Option 2) Using your own PC as UPC ]</figcaption></figure><h2 id="lidar-information" tabindex="-1">LiDAR Information <a class="header-anchor" href="#lidar-information" aria-label="Permalink to &quot;LiDAR Information&quot;">‚Äã</a></h2><p>You can access the LiDAR sensors via the following IP addresses:</p><ul><li><strong>Left LiDAR IP Address:</strong> <code>192.168.30.10</code></li><li><strong>Right LiDAR IP Address:</strong> <code>192.168.30.11</code></li></ul><p>Use these addresses to connect to the respective LiDAR sensors for data collection and monitoring.</p><h3 id="additional-information" tabindex="-1">Additional Information <a class="header-anchor" href="#additional-information" aria-label="Permalink to &quot;Additional Information&quot;">‚Äã</a></h3><ul><li>The LiDAR sensors used in this system are <strong>LakiBeam 1L</strong>.</li><li>For more details and documentation, visit the official site:<br><a href="https://www.richbeam.com/en/download" target="_blank" rel="noreferrer">RichBeam LakiBeam 1L Documentation</a></li></ul><h3 id="example-code" tabindex="-1">Example Code <a class="header-anchor" href="#example-code" aria-label="Permalink to &quot;Example Code&quot;">‚Äã</a></h3><p>A simple example code for printing LiDAR data is available at the following repository:<br><a href="https://github.com/RainbowRobotics/lakibeam-1l-test.git" target="_blank" rel="noreferrer">RainbowRobotics/lakibeam-1l-test</a></p><p>This example demonstrates basic usage of the LakiBeam 1L LiDAR sensors.</p>',28)]))}const b=e(r,[["render",l]]);export{f as __pageData,b as default};
